import logo from './logo.svg';
import './App.css';

let sum = 0;
for(let num of [1,2,3,4,5]) {
  sum += num;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <h1>
            Coin Exchange {sum}
          </h1>
      </header>
      <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Ticker</th>
          <th>Price</th>
        </tr>
      </thead>
      <tbody>
        <Coin name="Bitcoin" ticker="BTC" price="$35,000" />
        <Coin name="Ethereum" ticker="ETC" price="$1,400" />
      </tbody>
    </table>
    </div>
  );
}

export default App;
